const ABBREVIATION_SORT_ORDER = [
  'CEU-UCH', 'CEU-USP', 'UAB', 'UAH', 'UAM', 'UAX', 'UB', 'UCA', 'UC', 'UCAM',
  'UCLM', 'UCM', 'UCO', 'UCV', 'UdG', 'UdL', 'UEM', 'UEX', 'UFV', 'UGR',
  'UIB', 'UIC', 'UJI', 'ULL', 'ULPGC', 'UM', 'UMA', 'UMH', 'UNAV', 'UNIOVI',
  'UNIZAR', 'UPF', 'UPV/EHU', 'URJC', 'URV', 'US', 'USAL', 'USC', 'UVA',
  'UV', 'UVic-UCC', 'Univ UE', 'Univ NoUE'
];

export const customSort = (a: UniversityData | RawUniversityData, b: UniversityData | RawUniversityData) => {
  const indexA = ABBREVIATION_SORT_ORDER.indexOf(a.abbreviation);
  const indexB = ABBREVIATION_SORT_ORDER.indexOf(b.abbreviation);

  if (indexA === -1 && indexB === -1) return a.abbreviation.localeCompare(b.abbreviation);
  if (indexA === -1) return 1;
  if (indexB === -1) return -1;

  return indexA - indexB;
};


