export const UNIVERSITY_DATA_BY_YEAR: { [year: number]: UniversityData[] } = 
  Object.fromEntries(
    Object.entries(RAW_UNIVERSITY_DATA_BY_YEAR).map(([year, data]) => {
      const processedData = data.map(uni => {
        const withoutPlaceAbsolute = uni.presented - uni.placesAwarded;
        return {
            ...uni,
            withoutPlaceAbsolute: withoutPlaceAbsolute,
            percentageWithoutPlaceOverPresented: uni.presented > 0 ? (withoutPlaceAbsolute / uni.presented) * 100 : 0
        };
      });
      return [year, processedData.sort(customSort)];
    })
  );


export const ALL_UNIVERSITY_DATA: UniversityData[] = Object.values(UNIVERSITY_DATA_BY_YEAR).flat();